@Nichola Walker I actually said media outlet.

Their other news stories don't have anything to do with this. I'm not blind to the fact that IO know they're getting a lot of traction by covering this story, as a lot of people care about it. But frankly, since it is another source for alerting people to the reality of the situation, I don't care. Once again, there are many journalists that should be far above a YouTube channel in terms of professional integrity, who have blatantly made up or twisted aspects of this situation.

I'm confused as to why you are here, or keeping any tabs on IO, if you have dismissed it as a YouTube drama channel (which you clearly look down on).
